function Child({ onAbc }) {
  return (
    <>
      <div
        onClick={() => {
          alert(123);
        }}>
        123
      </div>
      <input
        onInput={() => {
          // input的时候回触发 onAbc事件
          onAbc();
        }}
        onChange={(val) => {
          console.log(val);
        }}></input>
    </>
  );
}

export default Child;
